You have played around with the intended heading of your boids, and noticed how they changed course. Let's try to make your boids go in circles, by changing intended heading periodically. So we want to change the heading of the boid slightly each time the brain server is requested to provide an intent. We can use the boid parameter that is passed to our function for that. We first introduce a variable that we can easily change called delta that will represent the amount of change in heading. Next we will set the intended heading to the boids current heading with the sleight alteration. delta := 1
{ "heading": boid.heading + delta, "speed": 0.005
} Boids going in circles
